## Description

In this PR, we consider the size of the LastCacheContainer object when calculating the SchemaCacheEntry.

```java
  public static int estimateSize(SchemaCacheEntry schemaCacheEntry) {
    // each char takes 2B in Java
    int lastCacheContainerSize =
        schemaCacheEntry.getLastCacheContainer() == null
            ? 0
            : schemaCacheEntry.getLastCacheContainer().estimateSize();
    return 100
        + 2 * schemaCacheEntry.getIMeasurementSchema().getMeasurementId().length()
        + lastCacheContainerSize;
  }
```

In addition, the value object may be changed when the `DualKeyCache#compute` method is called. In this case, the size of value needs to be recalculated and the memory statistics of the cache updated.

```java
          int originalValueSize = sizeComputer.computeValueSize(cacheEntry.getValue());
          computation.computeValue(i, cacheEntry.getValue());
          int usedMemorySize =
              sizeComputer.computeValueSize(cacheEntry.getValue()) - originalValueSize;
          cacheStats.increaseMemoryUsage(usedMemorySize);
          if (cacheStats.isExceedMemoryCapacity()) {
            executeCacheEviction(usedMemorySize);
          }
```

All of the above changes were verified in UT.

